pragma solidity >=0.7.0 <0.9.0;
// SPDX-License-Identifier: GPL-3.0

contract oddEve{
    uint public score;
    bool public out;
    uint randomvariable;

    constructor()
    {
        score = 0;
        out=false;
        randomvariable=1;
    }
    
    function takeinput(uint _inputnumber) public returns (string memory){
        
        if (out==true)
        {
            return "BatsmanIsOut.";
        }
        else
        {
            uint randomnumber =randdomnumbergenerator();
            if (_inputnumber<1 || _inputnumber >6){
                return "EnterValidNumber";
            }
            
            else if (out==false)
            {
                if (randomnumber==0)
                    randomnumber=6;

                if (randomnumber==_inputnumber)
                {
                    out=true;
                    return "-- OUT";	//yet to implement

                }
                else
                {
                    score = score + randomnumber;
                    return "randonumber RUNS";	//yet to implement
                }
            }
        }
    }

    function randdomnumbergenerator() private returns(uint)
    {
    // increase nonce
        unchecked{
            randomvariable++;
        } 
        return uint(keccak256(abi.encodePacked(block.timestamp, score, randomvariable))) % 6;
    }

    function reset() public returns(string memory)
    {
        score = 0;
        out=false;
        
        return "RESET Successfully";
    }
}

